import React from 'react';
import logo from './logo.svg';
import './App.css';

import 'whatwg-fetch';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <form className="app-intro" onSumit={this.handleSumint}>
          <imput type="text" onChange={this.handleChange} />
          <imput type="sumit" value="Echo" />
        </form> 

        </header>
    </div>
  );
}

export default App;
